import bisect

class Ruiwa:

    def __init__(self, a):
        self.H = h = len(a)
        self.W = w = len(a[0])
        self.R = r = a
        for i in range(h):
            for j in range(1, w):
                r[i][j] += r[i][j - 1]
        for i in range(1, h):
            for j in range(w):
                r[i][j] += r[i - 1][j]

    def search(self, x1, y1, x2, y2):
        if x1 > x2 or y1 > y2:
            return 0
        r = self.R
        rr = r[y2][x2]
        if x1 > 0 and y1 > 0:
            return rr - r[y1 - 1][x2] - r[y2][x1 - 1] + r[y1 - 1][x1 - 1]
        if x1 > 0:
            rr -= r[y2][x1 - 1]
        if y1 > 0:
            rr -= r[y1 - 1][x2]
        return rr

def count_treasures_in_regions(n, m, treasures, regions):
    xd = set()
    yd = set()
    for (x, y) in treasures:
        xd.add(x)
        yd.add(y)
    xl = sorted(list(xd))
    yl = sorted(list(yd))
    xx = {}
    yy = {}
    for i in range(len(xl)):
        xx[xl[i]] = i
    for i in range(len(yl)):
        yy[yl[i]] = i
    a = [[0] * (len(yl) + 1) for _ in range(len(xl) + 1)]
    for (x, y) in treasures:
        a[xx[x]][yy[y]] -= 1
    rui = Ruiwa(a)
    result = []
    for (x1, y1, x2, y2) in regions:
        xx1 = bisect.bisect_left(xl, x1)
        yy1 = bisect.bisect_left(yl, y1)
        xx2 = bisect.bisect(xl, x2) - 1
        yy2 = bisect.bisect(yl, y2) - 1
        result.append(rui.search(xx1, yy1, xx2, yy2))
    return result

